import React from 'react';
import './HomePage.css';
import NavigationContainer from './NavigationMenu.js';
import CardContainers from './Content.js'
import HeaderMenuContainer from './HeaderButton.js';




const Isi = () => {

    return(
        <div className="ContainerLuar2">
    <div className="ContainerDua">

        <div className="Header">Data Pasien</div>

        <HeaderMenuContainer/>


        <div className="CardContainer1">

           <Card
           imageDelete = {DeleteImage} 
           image={Kurt}
           nama="Nandhika"
           perawatan="Kontrol Gigi"
           jam="12:00"
       ></Card>

       <Card 
       imageDelete = {DeleteImage}
           image={Liam}
           nama="Pratama"
           perawatan="Kontrol Behel"
           jam="13:00"
       ></Card>


       <Card 
       imageDelete = {DeleteImage}
           image={Alex}
           nama="Putra"
           perawatan="Ganti Karet"
           jam="14:00"
       ></Card>


       <Card 
       imageDelete = {DeleteImage}
           image={Nuno}
           nama="Nesia"
           perawatan="Tambel gigi"
           jam="15:00"
       ></Card>

   </div>

   <div className="CardContainer1">

           <Card
           imageDelete = {DeleteImage} 
           image={Kurt}
           nama="Nandhika"
           perawatan="Kontrol Gigi"
           jam="12:00"
       ></Card>

       <Card 
       imageDelete = {DeleteImage}
           image={Liam}
           nama="Pratama"
           perawatan="Kontrol Behel"
           jam="13:00"
       ></Card>


       <Card 
       imageDelete = {DeleteImage}
           image={Alex}
           nama="Putra"
           perawatan="Ganti Karet"
           jam="14:00"
       ></Card>


       <Card 
       imageDelete = {DeleteImage}
           image={Nuno}
           nama="Nesia"
           perawatan="Tambel gigi"
           jam="15:00"
       ></Card>

   </div>


    </div>
    </div>

    );




};






const PasienContainer = () => {

    return(
       <div className="ContainerUtama">
         <NavigationContainer />
        <Isi />
        </div>


    );



};

export default PasienContainer;
